import React, {useEffect, useState} from 'react'

function Pokemon(props){
const [pokemonCard, setPokemonCard] = useState("");

const getPokemon = () => {
  const options = {
    method: 'GET',
    headers: {
      'X-RapidAPI-Key': 'b32397f1fcmsh935c3b21d22db73p1ab1b6jsn93997ae9ae46',
      'X-RapidAPI-Host': 'pokemon-tcg-card-prices.p.rapidapi.com'
    }
  };

  fetch('https://pokemon-tcg-card-prices.p.rapidapi.com/card?setId=33ee55f4-30d0-4900-850f-36a351fb9719&set=vivid-voltage&series=sword-and-shield', options)
  .then(response => response.json())
	.then(response => {
    console.log(response);
    setPokemonCard(response);
  })
	.catch(err => console.error(err));
    }


  return(
    <div>
      <button onClick={getPokemon()}>Get Pokemon</button>
      {JSON.stringify(pokemonCard, null, 2)}
    </div>
    )
  }

export default Pokemon;

const styles = {
